  <ion-card *ngIf="load && labels.length != 0" >
      <ion-item>
          <ion-datetime shape="round" #datet [value]="myDate.toString(datet.value)" displayFormat="DD/MM/YYYY HH:mm" (ionChange)="doSomething()"></ion-datetime>
      </ion-item>
    <ion-card-header>
      <ion-img
        class="_img"
        [src]="base64Image"
      ></ion-img>
    </ion-card-header>
    <ion-item>
        <ion-datetime  shape="square" #datet [value]="myDate.toString(datet.value)" displayFormat="MM/DD/YYYY HH:mm" (ionChange)="doSomething()"></ion-datetime>
    </ion-item>
    <ion-card-content class="background-image" >
        <h3 class="title">Most Likely: </h3>
      <ion-chip *ngFor="let label of labels" outline>
        <ion-icon name="ios-restaurant" ></ion-icon>
        <ion-label>{{ label.name | titlecase  }}</ion-label>
        <!-- <ion-button ion-button style="--background:white" > -->
        <ion-icon color="secondary"
          [id]="label.name"
          name="close"
          (click)="moveToUnwanted($event)"
        ></ion-icon>
        <!-- </ion-button> -->
      </ion-chip>
      <ion-button
        class="buttonIcon"
        ion-button
        shape="round"
        size="small"
        color="light"
        (click)="add()"
        *ngIf="counter < 10 && !click"
      >
        <ion-icon name="add"></ion-icon>
      </ion-button>
      <!-- <ion-item > -->
      <ion-input
        [hidden]="click == false"
        color="light"
        type="text"
        [(ngModel)]="value"
        #box
        (ionBlur)="click=false"
        (change)="addedLabel(box.value)"
        placeholder="Add Label"
        id="addL"
      ></ion-input>

      <!-- </ion-item> -->
    </ion-card-content>
    <ion-card-content class="background-image" >

      <h3 class="title" *ngIf="unwantedLabels.length != 0">Suggestions: </h3>
  <ion-chip *ngFor="let label of unwantedLabels">
    <!-- <ion-icon name="ios-restaurant" color="primary"></ion-icon> -->
    <ion-label>{{ label.name | titlecase  }}</ion-label>
    <ion-icon
    color="light"
      [id]="label.name"
      name="md-arrow-up"
      (click)="moveToWanted($event)"
    ></ion-icon>
  </ion-chip>
  
    </ion-card-content>
  </ion-card>
 

<ion-fab vertical="bottom" horizontal="end">
  <ion-fab-button color="light" size="medium">
    <ion-icon name="add"></ion-icon>
  </ion-fab-button>
  <ion-fab-list side="top">
      <ion-fab-button (click)="takePicture($event)"  color="light" size="small">
          <ion-icon name="camera"></ion-icon>
          </ion-fab-button>
    <ion-fab-button routerLink="../home" color="light" size="small">
      <ion-icon name="calendar"></ion-icon>
    </ion-fab-button>
    <label style="size: 5000px" for="file-input-option">
      <ion-fab-button color="light" size="small">
        <ion-icon name="cloud-upload"></ion-icon>
      </ion-fab-button>
    </label>
    <input
      type="file"
      id="file-input-option"
      accept="image/*"
      capture="camera"
      (change)="sendImage($event)"
      style="display: none"
    />‏
  </ion-fab-list>
</ion-fab>

<ion-button    (click)="uploadData()" [hidden]="labels.length> 0"  color="light">save
    </ion-button>
</ion-content>
